import React, { Component } from "react";
import "./App.css";
import { HashRouter } from "react-router-dom";

class App extends Component {
    render() {
        return (
            <div className="App">
                <div className="App_Navbar">
                    <input
                        className="App_Navbar_Plus_Button"
                        type="button"
                        value="+"
                    />
                </div>
            </div>
        );
    }
}

export default App;
